public boolean equals(Object o) {
  if (this == o) {
    return true;
  }
  if (o == null || getClass() != o.getClass()) {
    return false;
  }

  AttemptPathIdentifier that = (AttemptPathIdentifier) o;

  if (!attemptId.equals(that.attemptId)) {
    return false;
  }
  if (!jobId.equals(that.jobId)) {
    return false;
  }

  return true;
}
